import time

class TopVotedCandidate:

    def __init__(self, persons, times):
        self.persons = persons
        self.times = times
        
        min_v = times[0]
        max_v = times[0]
        max_p = max(persons)

        winner = [[]] * len(times)

        max_vote = 0
        last_winner = persons[0]
        p_vote = [0] * (max_p+1)

        for time in range(len(times)):
            p_vote[persons[time]] += 1

            if p_vote[persons[time]] >= max_vote:
                max_vote = p_vote[persons[time]]
                last_winner = persons[time]

            winner[time] = last_winner

        time_idx = [[]] * (max(times)+1)
        t_idx = 0
        last_idx = 0
        for i in range(len(time_idx)):
            if t_idx < len(times) and i == times[t_idx]:
                last_idx = t_idx
                t_idx += 1

            time_idx[i] = last_idx

        self.winner = winner
        self.time_idx = time_idx

    def q(self, t: int) -> int:
        t_idx = min(t, len(self.time_idx)-1)
        
        return self.winner[self.time_idx[t_idx]]
        

